    <div className="water-tracker__name">
      <h2>Rahma</h2>
      <div className="water-tracker__amount">80 milli</div>
    </div>
    <div className="water-tracker__name">
      <h2>salah</h2>
      <div className="water-tracker__amount">80 milli</div>
    </div>
    <div className="water-tracker__name">
      <h2>asmaa</h2>
      <div className="water-tracker__amount">80 milli</div>
    </div>
    <div className="water-tracker__name">
      <h2>mamo</h2>
      <div className="water-tracker__amount">80 milli</div>
    </div>
  </Card>;
};

export default WaterTrackerItem;
